const TableRowData=({data,InVolt,num})=>{
    return(
        <>
        <tr>
            <td>{InVolt}</td>
            <td>{data[num][0]}</td>
            <td>{data[num][1]}</td>
        </tr>
        </>
    )
}

export default TableRowData;
